import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

class FranciscoInfo extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row><br /><br /></Row>
                    <Row>
                        <h1>Francisco</h1>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default FranciscoInfo;
